import "../styles/globals.css";
import "bootstrap/dist/css/bootstrap.css";
import Nav from "../components/nav";

function MyApp({ Component, pageProps }) {
  return (
    <>
      <Nav />
      <Component {...pageProps} />
    </>
  );
}

export default MyApp;
